import React from 'react';
import { Link } from 'react-router-dom';
const Navigation = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/home">Home</Link>
                </li>
                <li>
                    <Link to="/pans">Hot Pans</Link>
                </li>
                <li>
                    <Link to="/chat">Chat with local Pans in your area</Link>
                </li>
            </ul>
        </nav>
    );
};
export default Navigation
